{
    "Comment": "adhoc",
    "StartAt": "START adhoc extracts",
    "States": {
        "START adhoc extracts": {
            "Type": "Pass",
            "InputPath": "$",
            "OutputPath": "$",
            "Next": "CHECK 212778050_NM_1"
        },
        "CHECK 212778050_NM_1": {
            "Type": "Choice",
            "Choices": [
                {
                    "Variable": "$.INPUT.212778050_NM_1",
                    "StringEquals": "Y",
                    "Next": "SKIP 212778050_NM_1"
                }
            ],
            "Default": "EXTRACT 212778050_NM_1"
        },
        "EXTRACT 212778050_NM_1": {
            "Type": "Task",
            "Resource": "arn:aws:states:::glue:startJobRun.sync",
            "Parameters": {
                "JobName": "us-prod-daasbatchextract",
                "Arguments": {
                    "--application_name": "adhoc",
                    "--extract_number": "30"
                }
            },
            "ResultPath": null,
            "Catch": [
                {
                    "ErrorEquals": [
                        "States.ALL"
                    ],
                    "ResultPath": null,
                    "Next": "CHECK 212778050_NM_2"
                }
            ],
            "Next": "CHECK 212778050_NM_2"
        },
        "SKIP 212778050_NM_1": {
            "Type": "Pass",
            "Next": "CHECK 212778050_NM_2"
        },
        "CHECK 212778050_NM_2": {
            "Type": "Choice",
            "Choices": [
                {
                    "Variable": "$.INPUT.212778050_NM_2",
                    "StringEquals": "Y",
                    "Next": "SKIP 212778050_NM_2"
                }
            ],
            "Default": "EXTRACT 212778050_NM_2"
        },
        "EXTRACT 212778050_NM_2": {
            "Type": "Task",
            "Resource": "arn:aws:states:::glue:startJobRun.sync",
            "Parameters": {
                "JobName": "us-prod-daasbatchextract",
                "Arguments": {
                    "--application_name": "adhoc",
                    "--extract_number": "31"
                }
            },
            "ResultPath": null,
            "End": true
        },
        "SKIP 212778050_NM_2": {
            "Type": "Pass",
            "End": true
        }
    }
}
